function findWord(j,result2){
	for (let m=0;m<largeDict.length;m++){
		if (manualOutput(words[j],largeDict[m])==result2){
			return largeDict[m];
		}
	}
	return createWord(words[j],result2);
}
function start(){
	for (let a=0;a<20;a++){
		createSquares()
	}
	var id = setInterval(frame,5);
	counter = 0;
	function frame(){
		if(counter == 600){
			clearInterval(id);
			inProgress = false;
		}
		else{
			var instanceNum = Math.floor(counter/30)
			var wordNum = Math.floor((counter%30)/5);
			var squareNum = counter%5;
			var ptrn = getPattern(instanceNum);
			var ptrn2 = ptrn[wordNum];
			var color1 = ptrn2.charAt(squareNum);
			flipTile(counter, color1);
			counter++;
		}
	}
	
}
const flipTile = (tileNum, state) => {
  let tile = document.getElementsByClassName('div')[tileNum]
  tile.classList.add('flip-in');
  setTimeout(() => {
    tile.classList.add(state);
  }, 250);
  setTimeout(() => {
    tile.classList.remove('flip-in');
    tile.classList.add('flip-out');
  }, 250);
  setTimeout(() => {
    tile.classList.remove('flip-out');
  }, 1500);
};
function createWord(correct,result){
	for (let a=0; a<26;a++){
		for (let b=0; b<26; b++){
			for (let c=0; c<26; c++){
				for (let d=0; d<26; d++){
					for (let e=0; e<26; e++){
						tmpStr = alphabet[a]+alphabet[b]+alphabet[c]+alphabet[d]+alphabet[e];
						output = manualOutput(correct, tmpStr)
						if (output==result){
							largeDict.push(tmpStr);
							return tmpStr
						}
					}
				}
			}
		}
	}
}
