function manualOutput(right, attempt){
	var tempRes = ["r","r","r","r","r"];
	var storage = []
	for (let i=0;i<5;i++){
		if (right.charAt(i)==attempt.charAt(i)){
			tempRes[i] = "g";
		}
	}
	for (let i=0;i<5;i++){
		if (tempRes[i]=="g"){
			continue;
		}
		for (let j=0;j<5;j++){
			var dbl = false;
			if (tempRes[j]=="g"){
				continue;
			}
			if (right.charAt(i)==attempt.charAt(j)){
				for (let a=0;a<storage.length;a++){
					if (i==storage[a][0]){
						dbl = true;
					}
				}
				if (!dbl){
					if(tempRes[j] !="y"){
						var tempStrg = [i,j]
						storage.push(tempStrg);
						tempRes[j]="y";//error when there are 2 letters on the thing like serve and chess it displays yyrry even tho it shouldnt
					}
				}

			}
		}
	}
	var tempStr = "";
	for (let i=0; i<5; i++){
		tempStr+=tempRes[i];
	}
	return tempStr;
}